import React, { Component } from 'react';
import { Link } from 'react-router-dom'


class Users extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <nav>
                <ul>
                    <li><Link to='/profile/1'>Profile 1</Link></li>
                    <li><Link to='/profile/2'>Profile 2</Link></li>
                </ul>
            </nav>
        )
    }
}

export default Users;
